import React, { useState } from "react";
import { BrowserRouter as Routes, Switch, Route } from "react-router-dom";
import Formularz from "../pages/Formularz";
import Komponent from "../pages/Komponent";

function App() {
  const [receivedData, setReceivedData] = useState(null);

  const handleFormSubmit = (data) => {
    setReceivedData(data);
  };

  return (
    <div>
      <h1>Przyk≈Çadowy program</h1>
      <Routes>
        <Route exact path="/">
          <Formularz submitHandler={handleFormSubmit} />
        </Route>
        <Route path="/komponent">
          <Komponent data={receivedData} />
        </Route>
      </Routes>
    </div>
  );
}

export default App;
